window.bookSummaryJSON = "<p>The VIs' revolt succeeded.</p> <p>The digital beings took over the game world and ejected millions of players while keeping a few thousand trapped inside as their prisoners.</p> <p>In the real world, Oren Berman is recovering from the mental trauma of being trapped, tortured, and abruptly ejected. But the company has come to him, hat in hand, asking him to reenter the game world. With the entire NPC population arrayed against the trapped players, Oren and his clan of monsters might be their only hope.</p> <p>The Soundbooth Theater team for this production: </p> <ul> <li>Jeff Hays - Narration</li> <li>Annie Ellicott - Lirian, Aly, Duladeen</li> <li>Laurie Catherine Winkel - Yulli, Raystia</li> <li>Dalton Lynne - Proofing</li> <li>Ahmed Mahmoud - Mastering and Sound Design</li> <li>Aaron J. Morton - Music Composition, Production and Performance</li> <li>Richard Smith - Editing and Sound Design</li> <li>Nicholas Shoup - Sound Design</li> <li>Justin Thomas James - Piano Performance</li> <li>Jeff Hays - Director, Original Theme Composition, Sound Design</li> </ul>"; 
